import React from 'react';
import {
  Chart as ChartJS,
  ArcElement,
  Tooltip,
  Legend,
} from 'chart.js';
import { Doughnut } from 'react-chartjs-2';

ChartJS.register(ArcElement, Tooltip, Legend);

interface ResultQualityPieProps {
  qualityScore: number; // 0 to 1
}

const ResultQualityPie: React.FC<ResultQualityPieProps> = ({ qualityScore }) => {
  // Convert score to percentage
  const percentage = Math.round(qualityScore * 100);
  const remaining = 100 - percentage;

  // Determine colors based on quality score
  const getQualityColor = (score: number) => {
    if (score >= 0.8) return '#10B981'; // Green - Excellent
    if (score >= 0.6) return '#F59E0B'; // Yellow - Good  
    if (score >= 0.4) return '#F97316'; // Orange - Fair
    return '#EF4444'; // Red - Poor
  };

  // Determine quality label
  const getQualityLabel = (score: number) => {
    if (score >= 0.8) return 'Excellent';
    if (score >= 0.6) return 'Good';
    if (score >= 0.4) return 'Fair';
    return 'Needs Review';
  };

  // Determine status colors for legend
  const getStatusColors = (score: number) => {
    if (score >= 0.6) {
      // Good quality - show mostly green
      return {
        good: percentage,
        bad: remaining,
        goodColor: '#10B981',
        badColor: '#E5E7EB'
      };
    } else {
      // Poor quality - show mostly red
      return {
        good: percentage,
        bad: remaining,
        goodColor: '#E5E7EB',
        badColor: '#EF4444'
      };
    }
  };

  const statusColors = getStatusColors(qualityScore);
  const qualityColor = getQualityColor(qualityScore);
  const qualityLabel = getQualityLabel(qualityScore);

  const data = {
    datasets: [
      {
        data: [percentage, remaining],
        backgroundColor: [qualityColor, '#E5E7EB'],
        borderWidth: 0,
        cutout: '70%',
      },
    ],
  };

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        display: false,
      },
      tooltip: {
        enabled: false,
      },
    },
  };

  return (
    <div style={{ textAlign: 'center' }}>
      <div style={{ position: 'relative', height: '200px', width: '200px', margin: '0 auto' }}>
        <Doughnut data={data} options={options} />
        <div
          style={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            textAlign: 'center',
          }}
        >
          <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#374151' }}>
            {percentage}%
          </div>
          <div style={{ fontSize: '0.875rem', color: '#6B7280' }}>
            Quality
          </div>
        </div>
      </div>
      
      <div style={{ marginTop: '1rem' }}>
        <div style={{ 
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: 'center',
          marginBottom: '0.5rem' 
        }}>
          <span style={{ 
            fontSize: '1.2rem', 
            marginRight: '0.5rem' 
          }}>
            {qualityScore >= 0.8 ? '✅' : 
             qualityScore >= 0.6 ? '⚡' : 
             qualityScore >= 0.4 ? '⚠️' : '⚠️'}
          </span>
          <span style={{ 
            fontWeight: '500', 
            color: qualityColor,
            fontSize: '1rem'
          }}>
            {qualityLabel}
          </span>
        </div>
        
        <div style={{ 
          display: 'flex', 
          justifyContent: 'center', 
          gap: '1rem',
          fontSize: '0.875rem'
        }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '0.25rem' }}>
            <div
              style={{
                width: '12px',
                height: '12px',
                backgroundColor: statusColors.goodColor,
                borderRadius: '2px',
              }}
            />
            <span>Good: {statusColors.good}%</span>
          </div>
          <div style={{ display: 'flex', alignItems: 'center', gap: '0.25rem' }}>
            <div
              style={{
                width: '12px',
                height: '12px',
                backgroundColor: statusColors.badColor,
                borderRadius: '2px',
              }}
            />
            <span>Bad: {statusColors.bad}%</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ResultQualityPie;
